import React, { Component } from 'react';


class Footer extends Component {


    render() { 
        var footerStyle = {
            marginBottom: '0',
            marginTop: '20rem',
            outlineStyle: "solid"   
        }

        var optionStyle = {
            marginBottom: '0',
            outlineStyle: "solid"   
        }

        return (
        <div className="container" style={footerStyle}>

            <div className="row">
                <div className="column column-50" style={optionStyle}><p>Option 1</p></div>
                <div className="column column-50" style={optionStyle}><p>Option 2</p></div>
            </div>

        </div>
            );
    }
}
 
export default Footer;
